import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
function Upperbanner() {
  return (
    <div
      style={{ backgroundColor: "#263F53" }}
      className="d-flex align-items-center justify-content-evenly text-white"
    >
      <p>100% Digital Transformation of Hostel</p>
      <p>Transforming Hostel Management, One Innovation at a Time</p>
      <p>Experience the Future of Hostel Management</p>
    </div>
  );
}

export default Upperbanner;
